import React, { Component } from 'react';
import NewsItem from './NewsItem';
import Spinner from './Spinner';
import PropTypes from 'prop-types';

export default class News extends Component {
  static defaultProps = {
    country: 'us',
    pageSize: 5,
    category: 'general',
  };

  static propTypes = {
    country: PropTypes.string,
    pageSize: PropTypes.number,
    category: PropTypes.string,
    apiKey: PropTypes.string.isRequired,
    setProgress: PropTypes.func.isRequired,
  };

  constructor(props) {
    super(props);
    this.state = {
      articles: [],
      loading: false,
      page: 1,
      totalResults: 0,
      apiError: null,
    };
    document.title = `${this.capitalizeFirstLetter(this.props.category)} - NewsApp`;
  }

  capitalizeFirstLetter = (string) => {
    return string.charAt(0).toUpperCase() + string.slice(1);
  };

  async fetchNews() {
    // Show loading progress
    this.props.setProgress(10);
    this.setState({ loading: true, apiError: null });

    // Add slight delay to prevent rate limiting
    await new Promise(resolve => setTimeout(resolve, 500));

    try {
      // Try Mediastack API first
      let url = `http://api.mediastack.com/v1/news?access_key=${this.props.apiKey}&countries=${this.props.country}&limit=${this.props.pageSize}&offset=${(this.state.page - 1) * this.props.pageSize}`;
      
      if (this.props.category !== 'general') {
        url += `&categories=${this.props.category}`;
      }

      this.props.setProgress(30);
      let response = await fetch(url);
      let data = await response.json();

      // Check for API errors
      if (data.error) {
        throw new Error(data.error.message || 'API Error');
      }

      this.props.setProgress(70);
      return {
        articles: data.data || [],
        totalResults: data.pagination?.total || data.data?.length || 0,
      };
    } catch (error) {
      console.error("Mediastack API Error:", error);
      throw error; // Re-throw to handle in updateNews
    }
  }

  async updateNews() {
    try {
      const newsData = await this.fetchNews();
      this.setState({
        articles: newsData.articles,
        totalResults: newsData.totalResults,
        loading: false,
      });
    } catch (error) {
      this.setState({
        loading: false,
        apiError: error.message.includes('429') 
          ? 'Too many requests. Please wait a moment and try again.' 
          : 'Failed to load news. Please try again later.'
      });
    } finally {
      this.props.setProgress(100);
    }
  }

  async componentDidMount() {
    await this.updateNews();
  }

  handlePrevClick = async () => {
    this.setState(
      (prevState) => ({ page: prevState.page - 1 }),
      async () => await this.updateNews()
    );
  };

  handleNextClick = async () => {
    this.setState(
      (prevState) => ({ page: prevState.page + 1 }),
      async () => await this.updateNews()
    );
  };

  render() {
    const { articles, loading, page, totalResults, apiError } = this.state;
    const { pageSize } = this.props;

    return (
      <div className="container my-3">
        <h1 className="text-center" style={{ margin: '35px 0px' }}>
          NewsApp - Top {this.capitalizeFirstLetter(this.props.category)} Headlines
        </h1>
        
        {apiError && (
          <div className="alert alert-danger" role="alert">
            {apiError}
          </div>
        )}

        {loading && <Spinner />}

        {!loading && !apiError && (
          <>
            <div className="row">
              {articles.map((article) => (
                <div className="col-md-4" key={article.url || article.title}>
                  <NewsItem
                    title={article.title || ''}
                    description={article.description || ''}
                    imageUrl={article.image || 'https://via.placeholder.com/300'}
                    newsUrl={article.url}
                    author={article.author || 'Unknown'}
                    date={article.published_at}
                    source={article.source}
                  />
                </div>
              ))}
            </div>

            <div className="container d-flex justify-content-between my-3">
              <button
                disabled={page <= 1}
                className="btn btn-dark"
                onClick={this.handlePrevClick}
              >
                &larr; Previous
              </button>
              <button
                disabled={page >= Math.ceil(totalResults / pageSize)}
                className="btn btn-dark"
                onClick={this.handleNextClick}
              >
                Next &rarr;
              </button>
            </div>
          </>
        )}
      </div>
    );
  }
}
